import styled from "styled-components";
import MainSecTitleCTA from './MainSecTitleCTA'
import MainSecVideoCTA from './MainSecVideoCTA'
import { MainSecButtonCTA } from "./MainSecButtonCTA";

const SectionCTA = styled.section`
    width: 100%;
    margin: 0 auto;
    padding: 2rem;
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;
`
const DivContainer = styled.div`
    width: 100%;
    margin: 0 auto;
`

function Section02() {
    return (
        <SectionCTA>
            <div>
                <MainSecTitleCTA />
                <MainSecVideoCTA />
            </div>

            <MainSecButtonCTA />
        </SectionCTA>
    )
}

export default Section02
